import React, { useState, useEffect, Context } from "react";
import Box from "@mui/material/Box";
import Container from "@mui/material/Container";
import Card from "@mui/material/Card";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import { TextFieldComponent } from "../../components/TextFieldComponent";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";

import Select, { SelectChangeEvent } from "@mui/material/Select";
import "./style.css";

export const Form = (props: any): JSX.Element => {
  const { formReducer } = props;
  const [age, setAge] = React.useState("");

  const handleChange = (event: SelectChangeEvent) => {
    setAge(event.target.value as string);
  };

  return (
    <Container maxWidth="xl">
      <Box>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <Card variant="outlined" className="center">
              <h2>Add New</h2>
              <div className="form_section">
                <FormControl className="input_size">
                  <InputLabel id="demo-simple-select-label">Age</InputLabel>
                  <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={age}
                    label="Age"
                    onChange={handleChange}
                  >
                    {formReducer.users.map((user: any, index: number) => (
                      <MenuItem value={user.id} key={index}>{user.id}</MenuItem>
                    ))}
                  </Select>
                </FormControl>

                <TextFieldComponent
                  color="primary"
                  id="text-title"
                  name="title"
                  label="Title"
                  className="input_size"
                />

                <TextFieldComponent
                  color="primary"
                  id="text-body"
                  name="body"
                  label="Body"
                  multiline={true}
                  className="input_size"
                />
              </div>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
};
